eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"AccordianSectiondata\": () => (/* binding */ AccordianSectiondata),\n/* harmony export */   \"CarBackgroundEditingReadMoreContentData\": () => (/* binding */ CarBackgroundEditingReadMoreContentData),\n/* harmony export */   \"ToolSectionData\": () => (/* binding */ ToolSectionData),\n/* harmony export */   \"heroSectionData\": () => (/* binding */ heroSectionData),\n/* harmony export */   \"imageUpscalingData\": () => (/* binding */ imageUpscalingData)\n/* harmony export */ });\nconst heroSectionData = {\n    heading: {\n        spynebluetitle: \"Free \",\n        title: \"Car Background Editing App Online\"\n    },\n    subHeading: {\n        title: \"Get High-Quality Images Through Car Background Editing. Powered by \",\n        subtile: \"Spyne.ai\",\n        url: `${\"\"}`\n    },\n    dropZone: {\n        smallText: \"Drop an image\",\n        resolutionText: \"(upto resolution 5,000 x 5,000 px)\",\n        uploadIcon: `${\"\"}/AI-tools/photo-upscaler/upload-white.svg`,\n        uploadBtnText: \"Upload an image\",\n        pickImageText: \"No image to upload ? Pick one\"\n    },\n    beforeAfterData: {\n        beforeImg: `https://spyne-static.s3.amazonaws.com/AI-tools/background+replacement/bfrrr+2.webp`,\n        afterImg: `https://spyne-static.s3.amazonaws.com/AI-tools/background+replacement/aftrrr+1.webp`\n    }\n};\nconst imageUpscalingData = {\n    heading: \"What is Car Background Editing?\",\n    description: \"Car background editing refers to changing the background of car images, to make it more appealing to viewers or to bring attention to the subject. Editors can transform the car image background into a natural landscape, a branded storefront, a high-end showroom, or a professional studio backdrop. The primary goal is to ensure that the vehicle remains the central focus of the images, by removing unwanted and inappropriate elements from your car's background image and enhancing the visual appeal of your car.\",\n    cardsData: [\n        {\n            key: \"uploadImage\",\n            image: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/upscalingprocess1.svg`,\n            title: \"1. Upload an image\",\n            subTitle: \"Select or upload a sample image from the options provided above.\"\n        },\n        {\n            key: \"uploadImage\",\n            image: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/upscalingprocess2.svg`,\n            title: \"2. Edit Car Background\",\n            subTitle: \"Click and edit your car image\"\n        },\n        {\n            key: \"uploadImage\",\n            image: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/upscalingprocess3.svg`,\n            title: \"3. Download \",\n            subTitle: \"Download the output in PNG format\"\n        }\n    ]\n};\nconst ToolSectionData = {\n    heading: \"Consistent Looking Car Images In Seconds\",\n    subheading: \"Online retail is rising, and the automobile industry is also on that bandwagon. Car retail businesses,\",\n    toggleFirst: \"Read More\",\n    toggleSecond: \"Read Less\",\n    arrowimg: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/rightArrow.svg`,\n    aienhancmentgif: `${\"\"}/wp-content/uploads/2023/06/ai-tools-gif.webp`\n};\nconst AccordianSectiondata = {\n    heading: \"Got any questions ?\",\n    questions: [\n        {\n            question: \"What backgrounds can enhance my car photography\",\n            content: \"When creating car catalogs and online vehicle listings, it’s best to choose a simple and decluttered background. A messy backdrop will only bring the visual appeal down. Also, the focus should always be on the car, so never draw too much attention to a picture. If the raw images aren’t up to the mark, then consider editing the background in car photos.\"\n        },\n        {\n            question: \"How do I take pictures for selling a car online?\",\n            content: \"Clicking car pictures for a marketplace or dealership website isn’t easy, but you can follow these steps for the best output: Select an appropriate location. If you can’t, use a car background removal tool. Check for correct lighting. Outdoor shoots are best done at dawn or dusk. As for indoor shoots, studio lighting doesn’t have any time limit. Shoot from multiple angles. That way, you can showcase your vehicle accurately, allowing buyers to know exactly what they’re looking at. You can hire a professional photographer for your car photoshoots, or use self-serve photography solutions like Spyne. With the latter, you have the option for editing full HD car backgrounds into your images, that too 100% automatically!\"\n        },\n        {\n            question: \"How can I put a background on my car picture?\",\n            content: \"You can use manual editing software such as Adobe Photoshop, GIMP, and PicMonkey to edit your car photographs and add custom backdrops, giving them a personalized touch.\"\n        },\n        {\n            question: \"Which app is good for car background editing?\",\n            content: \"Spyne Virtual Studio allows you to replace and remove the background of your car photos with just a few clicks.\"\n        }\n    ]\n};\nconst CarBackgroundEditingReadMoreContentData = {\n    Description: \"including dealerships and marketplaces, are busy improving their digital presence in the digital world. High-quality, professional-looking vehicle images are necessary for that, and to that end, many businesses are relying on car background editing.\",\n    SubDescription: \"A good background can make a massive difference to your car images. Clean, premium backdrops make your pictures feel upmarket, while poor ones bring a dip in the visual quality. These days, plenty of dealership websites and marketplaces are utilizing new-age merchandising solutions for improving image quality, while many others are still employing traditional photo editing methods.\",\n    FirstHeading: {\n        Heading: \"Who Needs Car Background Editing Software?\",\n        Description: \"Car retailers – including car dealerships, independent car sellers, and automobile marketplaces – need Car Background Editing Software to create high-quality product images to drive sales. Messy and cluttered product images don’t look too appealing to potential consumers. Appropriate editing will help you beautify your product pictures to capture more eyeballs. This isn’t just true for online retailers; even offline sales are affected by product images posted on the World Wide Web.\"\n    },\n    SecondHeading: {\n        Heading: \"Why Do You Need Car Image Background Editing?\",\n        Description: \"As per Google statistics, 59% of car buyers research online before purchasing a new automobile. To capture these eyeballs, it is extremely important to have high-quality images that show your cars in detail.\",\n        SecondDescription: \"By editing car backgrounds in your images, you can ensure that said images look good, no matter the circumstances in which they were shot. The original pictures could have cluttered or boring backgrounds, but you can edit them out and improve the visual appeal, bring attention to the vehicle, etc.\"\n    },\n    ThirdHeading: {\n        Heading: \"What are the Advantages of Using a Car Background Editing App?\",\n        Description: \"There are plenty of benefits of using a Car Background Editing App:\",\n        Points: [\n            {\n                Point: \"Enhance your website\"\n            },\n            {\n                Point: \"Attract consumer attention\"\n            },\n            {\n                Point: \"Increase focus on the car\"\n            },\n            {\n                Point: \"Better social media marketing\"\n            },\n            {\n                Point: \"Improve consumer impact\"\n            },\n            {\n                Point: \"Increase car sales\"\n            }\n        ],\n        SubDescription: \"Let’s dive a little deeper into it all.\",\n        FirstSubHeading: {\n            Heading: \"1. Enhance your website\",\n            DescriptionOne: \"If your images have random backgrounds, i.e., your pictures were shot in different locations or had varying amounts of clutter, your dealership website/marketplace wouldn’t look organized. It would instead look like an assortment of random cars. Thus, you risk developing a poor consumer image for your business/brand.\",\n            DescriptionTwo: \"Car background photo editing enhances your VDPs and makes your website look professional and upmarket.\",\n            DescriptionThree: \"Your website is crucial for your car retail business; it should be a digital extension of your brick-and-mortar dealership. Studies show that around 76% of consumers check out a company’s online presence before visiting a physical store. Uniform, high-impact car listings will help you in that regard.\"\n        },\n        SecondSubHeading: {\n            Heading: \"2. Attract consumer attention\",\n            DescriptionOne: \"You need your car listings to attract people, don’t you? Your website – or digital dealership as it’s popularly called – needs to attract as many leads as possible. With the proper car background editing, you can create high-quality images, making it easier to grab eyeballs on the World Wide Web.\",\n            DescriptionTwo: \"Imagine this – there are two online automobile marketplaces. One has listings with cluttered car pictures, along with random images on each VDP. The other has listings with clean, uniform-looking car images. Further, each VDP has a set of professionally shot images covering the vehicle from different angles. Which one do you think attracts more attention from buyers?\",\n            DescriptionThree: \"As per Google’s research, 95% of vehicle buyers use digital platforms for information before purchasing. Capturing these people in the initial stages of their buying journey will give your business a massive boost.\"\n        },\n        ThirdSubHeading: {\n            Heading: \"3. Increase focus on the car\",\n            DescriptionOne: \"A good product image should look pretty and always keep the subject (i.e., the car) in focus. The environment should neither take attention away from the product nor should it bring the visual appeal down. By editing backgrounds in car pictures, you can achieve this goal effectively.\",\n            DescriptionTwo: \"In fact, appropriate post-production of your car photographs can help beautify them significantly. Even if the original images were shot in a busy environment and/or with poor lighting, you could make changes (or hire someone to do it) later, ensuring that all your pictures look good.\"\n        },\n        FourthSubHeading: {\n            Heading: \"4. Better social media marketing\",\n            DescriptionOne: \"Background editing for car images will help you beyond just your website; it can assist you with impactful \",\n            DescriptionOneLink: \"https://www.spyne.ai/blogs/automotive-marketing\",\n            DescriptionOneLinkText: \"automotive marketing\",\n            DescriptionOneContinue: \" on social media as well! Around 82 percent of the US population is on at least one social platform, so the chances of finding potential buyers there are pretty high! In fact, the US Digital Trust Survey shows that around 48 percent of social media users have purchased something via a social platform.\",\n            DescriptionTwo: \"You can promote your car listings on different social platforms with targeting advertising, using high-impact images created thusly. You can also improve brand awareness; editing your brand or dealership logo into your car images smartly, along with uniform backdrops, will help with brand recall.\"\n        },\n        FifthSubHeading: {\n            Heading: \"5. Improve consumer impact\",\n            DescriptionOne: \"Professional, high-quality images bring a positive impact to your car retail business. As stated previously, these make your website look more premium. Clean, high-quality photographs covering a car from multiple angles and showing every detail improve the buying process’s transparency, building the consumer’s trust in your brand.\",\n            DescriptionTwo: \"For further impact, you can even highlight specific features on your cars that are worth noticing. E.g: On used cars, you can mark all the dents and damages, so that buyers know exactly what they’re getting. This makes customer research much, much more manageable.\"\n        },\n        SixthSubHeading: {\n            Heading: \"6. Increase car sales\",\n            DescriptionOne: \"Here’s the end goal – increasing sales! Car photo background editing improves the quality of your car listings, helps beautify your website and improves social media presence, eases consumer research, etc., increasing the chances of people buying a vehicle from you! In simple words: editing car backgrounds for your catalog images directly translates to better sales potential for your business.\"\n        }\n    },\n    FourthHeading: {\n        Heading: \"Car Photo Editing Backgrounds Related Features\",\n        FirstPara: \"This photo editing car background software can easily \",\n        FirstParaLink: \"https://www.spyne.ai/blogs/car-background-removal\",\n        FirstParaLinkText: \"remove car background\",\n        FirstParaContinue: \" and replace it with a new one. But the best car background editing software can do much more. Here are features that are a must to photo edit car backgrounds.\",\n        FirstSubHeading: {\n            Heading: \"1. Automatically remove car backgrounds\",\n            Description: \"Car sales demand quick removal of cluttered backgrounds. AI editors use AI to remove your original background and add a professional \",\n            DescriptionLink: \"https://www.spyne.ai/blogs/car-turntable\",\n            DescriptionLinkText: \"car turntable\",\n            DescriptionContinue: \" or dealership background in a fraction of a second. These images are ready to be used in your social media posts, advertising campaigns, and online listings.\"\n        },\n        SecondSubHeading: {\n            Heading: \"2. Change car background\",\n            Description: \"The key to selling cars online lies in having clean and consistent backgrounds throughout. Our AI editor changes your car image background with natural scenery, a branded storefront, a high-end showroom, or a professional studio, so your leads become your customers. You can choose the best car background for editing your images.\"\n        },\n        ThirdSubHeading: {\n            Heading: \"3. Adding shadows to your car images\",\n            Description: \"Regardless of the background, the car needs to have a shadow to give it a realistic look. Some AI editors automatically add a shadow to your car image with the background to give you results in a click faster. No need to add the background and shadow separately.\"\n        },\n        FourthSubHeading: {\n            Heading: \"4. Add logo and discount text to boost your sale\",\n            Description: \"Bring your dealership into the spotlight by adding your brand logo to your images. AI editors let you create branded car images by adding your brand logo on the number plate or adding it anywhere in the car image, with just a click.\"\n        }\n    },\n    FifthHeading: {\n        Heading: \"How to Edit Car Photo Background\",\n        DescriptionOne: \"Now that you know the benefits of car image background editing, let’s take a look at how to do it.\",\n        DescriptionTwo: \"For manual car photo editing, you’ll need a professional editor, along with the appropriate editing software and hardware. This will increase your expenses. Well, you could learn how to edit pictures yourself or get a staff member to do that. This would allow you to skip hiring additional help and reduce costs to an extent.\",\n        DescriptionThree: \"The second method – automated car photo editing – is much simpler. You don’t need to purchase extravagant hardware or hire professionals for the job. You only need a Spyne car background photo editor. The system does all the heavy lifting, thereby reducing your burden massively.\"\n    },\n    SixthHeading: {\n        Heading: \"Car Background Photo Editing – Manual VS Automated Editing\",\n        Description: \"Which car background photo editing method is the best for your business? Let’s understand both benefits and drawbacks to understand that better.\",\n        FirstSubHeading: {\n            Heading: \"Manual car photo editing\",\n            SubParaOne: \"The biggest benefit of editing car backgrounds manually is that it gives you more creative control over the entire process. Don’t like a particular portion in any image? Change it! Shadows falling inappropriately, or don’t enjoy the lighting? Change that as well!\",\n            SubParaTwo: \"The biggest drawback, however, is that manual photo editing of car background solutions isn’t scalable. If your car inventory size is small, you might not have problems regarding speed and quality. However, as your inventory size increases or if you have a massive lot with hundreds of cars, manual editing won’t serve your business needs properly.\",\n            SubParaThree: \"Another drawback here is the heavy expenses involved. As mentioned earlier, you’ll have to invest in expensive software (image editing applications like Adobe Photoshop) and hardware (powerful computers to run said software).\"\n        },\n        SecondSubHeading: {\n            Heading: \"Automated car photo editing\",\n            SubParaOne: \"For a car photo editing background software, you can use this app for AI-powered car editing features.\",\n            SubParaTwo: {\n                Points: [\n                    {\n                        Point: \"1. Install the Spyne app, which is available for both Android and iOS. If you don’t want to install the app, you can use Darkroom online through your browser.\"\n                    },\n                    {\n                        Point: \"2. Choose a car category on the app. If you are using Darkroom online, choose the automobile category.\"\n                    },\n                    {\n                        Point: \"3. Start a new project on the app.\"\n                    },\n                    {\n                        Point: \"4. Upload your images to be edited on the app or Darkroom.\"\n                    },\n                    {\n                        Point: \"5. Select the edits you want to make from the side panel. You can remove and replace car background for editing images with over 100+ background options that contain outdoor scenery, studios, showrooms, storefronts, or plain backgrounds.\"\n                    },\n                    {\n                        Point: \"6. Shadow generation is done automatically to save you time. You can also choose to add window tint to remove difficult reflections or use the number plate masking option to hide the number and add your brand logo.\"\n                    },\n                    {\n                        Point: \"7. Save the project, and the images are ready for download. These are now ready to be used on your VDPs, marketing campaigns, social media posts, or any other commercial use with no attribution required.\"\n                    }\n                ]\n            },\n            SubParaThree: \"If you work with a dealership management system, auction platform, or website managing service, Our API can integrate into your process seamlessly. It can work with your dealer platforms to integrate into your workflow with no extra effort on your part. No need to go through the process of reshooting images. We pick up your inventory images directly from your DMS, auction integration, or website management platform, beautify them, and send them directly to be published on your listings.\",\n            SubParaFour: {\n                Description: \"We have partnered with dealership, marketplace, and auction integration services listed below:\",\n                Points: [\n                    {\n                        Point: \"vAuto\"\n                    },\n                    {\n                        Point: \"Inventory+\"\n                    },\n                    {\n                        Point: \"MaxDigital\"\n                    },\n                    {\n                        Point: \"Homenet\"\n                    },\n                    {\n                        Point: \"Auction Edge\"\n                    },\n                    {\n                        Point: \"Auto Certo\"\n                    }\n                ],\n                SubDescription: \"We’re working to expand this list!\"\n            }\n        },\n        ThirdSubHeading: {\n            Heading: \"Which is better for your auto dealership\",\n            Description: \"If you have a small inventory size and the expenses aren’t a bother, then you can go for manual editing solutions. However, automated solutions are faster, more affordable, and offer consistent quality. There isn’t any practical reason to opt-out.\"\n        }\n    },\n    SeventhHeading: {\n        Heading: \"Car Background Editing Using Spyne AI\",\n        DescriptionOne: \"This AI-powered cataloging platform is a brilliant solution for all your car image background editing requirements. Through computer vision and deep learning, our AI systems are capable of detecting a vehicle in an image (or the subject in an image with many vehicles) and editing car backgrounds automatically.\",\n        DescriptionTwo: \"You can choose from over a hundred high-definition backgrounds from it’s library, depending on your needs. Editing full HD car backgrounds in your vehicle images and uplifting the quality of your catalogs is a breeze! There are multiple floor options (with and without virtual turntables) and various wall choices. Some backdrops even include outdoor locations.\",\n        DescriptionThree: \"Other than that, you can also choose to add custom backdrops, which could include your dealership branding, either subtly integrated into the environment or boldly placed in the images. For the images to look natural, It takes a few extra steps, like adding shadows and removing reflections!\"\n    },\n    Conclusion: {\n        Heading: \"Conclusion\",\n        FirstPara: \"Car background editing is a pivotal tool for enhancing your car images and attracting buyers. With this AI-powered automated solution, you can swiftly remove cluttered backgrounds, replace them with professional settings, and add shadows, logos, and more in just a few clicks. This approach raises website professionalism, captures consumer attention, and fosters trust. While manual editing is an option, it's time-consuming and costly, particularly as inventory scales. It offers a superior choice, streamlining the process and providing consistent quality and speed. Opt for this free AI to transform your car images, raise your online presence, and drive success in the competitive automotive market.\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./components/car-background-editing/config.js\n");

