eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"AccordianSectiondata\": () => (/* binding */ AccordianSectiondata),\n/* harmony export */   \"CarPhotoEditorAppReadMoreContentData\": () => (/* binding */ CarPhotoEditorAppReadMoreContentData),\n/* harmony export */   \"ToolSectionData\": () => (/* binding */ ToolSectionData),\n/* harmony export */   \"heroSectionData\": () => (/* binding */ heroSectionData),\n/* harmony export */   \"imageUpscalingData\": () => (/* binding */ imageUpscalingData)\n/* harmony export */ });\nconst heroSectionData = {\n    heading: {\n        spynebluetitle: \"Free \",\n        title: \"Online Car Photo Editor App\"\n    },\n    subHeading: {\n        title: \"Next Gen AI-Powered Vehicle Photo Editor App. Powered by \",\n        subtile: \"Spyne.ai\",\n        url: `${\"\"}`\n    },\n    dropZone: {\n        smallText: \"Drop an image\",\n        resolutionText: \"(upto resolution 5,000 x 5,000 px)\",\n        uploadIcon: `${\"\"}/AI-tools/photo-upscaler/upload-white.svg`,\n        uploadBtnText: \"Upload an image\",\n        pickImageText: \"No image to upload ? Pick one\"\n    },\n    beforeAfterData: {\n        beforeImg: `https://spyne-static.s3.amazonaws.com/AI-tools/background+replacement/bfrrr+2.webp`,\n        afterImg: `https://spyne-static.s3.amazonaws.com/AI-tools/background+replacement/aftrrr+1.webp`\n    }\n};\nconst imageUpscalingData = {\n    heading: \"What is a Car Photo Editor App?\",\n    description: \"A car photo editor is a photo editing app that helps you to adjust and modify your car pictures to the best. It can help you edit car background frames, change or adjust the colors, manipulate the subject and standardize them as per a template, add brand logos, and much more with just an app. These edited images find utility in various applications, including online product listings, promotional materials, and social media posts, making this app indispensable for creating captivating car visuals.\",\n    cardsData: [\n        {\n            key: \"uploadImage\",\n            image: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/upscalingprocess1.svg`,\n            title: \"1. Upload an image\",\n            subTitle: \"Select or upload a sample image from the options provided above.\"\n        },\n        {\n            key: \"uploadImage\",\n            image: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/upscalingprocess2.svg`,\n            title: \"2. Edit Car Background\",\n            subTitle: \"Click and edit your car image\"\n        },\n        {\n            key: \"uploadImage\",\n            image: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/upscalingprocess3.svg`,\n            title: \"3. Download \",\n            subTitle: \"Download your image in PNG format.\"\n        }\n    ]\n};\nconst ToolSectionData = {\n    heading: \"Guide to Get The Perfect Car Pictures\",\n    subheading: \"You need top-quality images when selling cars online, to showcase on your VDPs. Even offline sellers research their options online,\",\n    toggleFirst: \"Read More\",\n    toggleSecond: \"Read Less\",\n    arrowimg: `${\"\"}/AI-tools/photo-upscaler/trusted-enterprise/rightArrow.svg`,\n    aienhancmentgif: `${\"\"}/wp-content/uploads/2023/06/ai-tools-gif.webp`\n};\nconst AccordianSectiondata = {\n    heading: \"Got any questions ?\",\n    questions: [\n        {\n            question: \"What filters are good for car photos?\",\n            content: \"For car photos, two essential filters are neutral density filters and polarizing filters. Neutral density (ND) filters help control exposure in bright conditions, allowing for longer exposures, which can be beneficial for capturing motion or creating a soft background blur. Polarizing filters reduce reflections and enhance colors, making them ideal for minimizing glare on the car's surface and improving overall image clarity.\"\n        },\n        {\n            question: \"How can I edit car pictures easily?\",\n            content: \"You can edit your car pictures easily, quickly, and affordably using our AI. Thanks to the power of AI, the editing is automated, which saves you a lot of time and effort! You can follow these steps: Step 1: Import the images into the software Step 2: Select the background you want for your images. You can also request us to add custom backdrops to the library. Step 3: The system automatically replaces the background, adds a realistic shadow, removes reflection from the windows and windscreen, etc. Step 4: Download the edited images.\"\n        },\n        {\n            question: \"How can I make my car look better with my iPhone pictures?\",\n            content: \"If you use iPhone 8+, download our Spyne AI app for car photo editing. Follow these steps to make your car look better: 1) Open the Spyne AI smartphone app. 2) Choose the “automobile” category to proceed further. 3) Click on upload and select all the car images you want to process. 4) Upload your brand logo and select its position in the pictures (you can skip this step if you don’t wish to add your branding). 5) Check Spyne’s library of 100+ HD car backdrops in the photo editor, and choose the one you want. However, the free version has limited background options available. 6) Click on “Process Image” to apply the changes. The editing is 100% automatic! 7) Click on ‘Download’ to save the edited images.\"\n        },\n        {\n            question: \"How do you edit night car photos?\",\n            content: \"There are various techniques for editing night automobile images. The best method is to use the Spyne AI smartphone app to create the best automotive photography. The system automatically color-corrects the image, to compensate for the lighting or lack thereof. Also, any unwanted reflections on the window and windscreen of the vehicle are automatically removed, resulting in cleaner images.\"\n        },\n        {\n            question: \"Is there an auto photo editor?\",\n            content: \"Automatic photo editor Spyne has advanced tools like number plate masking and window tinting. Backed by AI technology, using Spyne is simple and easy. So if you are looking to enhance your automotive photo quality, this is the best software for you.\"\n        }\n    ]\n};\nconst CarPhotoEditorAppReadMoreContentData = {\n    Description: \"making the role of images on your website/marketplace listings even more crucial. To ensure the best quality, you’ll need the right car photo editor app to help you out.\",\n    SubDescription: \"Digitization has revolutionized every industry, including the automobile sector. Nowadays, every seller has to abide by the rules of digital retailing to attract more customers. If you want to spice up your car retail business, then you’ll need to find the best car photo editor for your business. Car image editors can broadly be classified into two categories:\",\n    SubPoints: [\n        {\n            Point: \"Manual editing apps\"\n        },\n        {\n            Point: \"Automated editing apps\"\n        }\n    ],\n    FirstSubHeading: {\n        Heading: \"Manual car photo editor apps\",\n        Description: \"Manual photo editing applications are the ones in which a user has to manually edit and enhance a photograph. This requires skill as well as experience; you need to either learn how to use such software or hire a professional to run them.\"\n    },\n    SecondSubHeading: {\n        Heading: \"Automated car photo editor apps\",\n        Description: \"Automated photo editing applications do not require a user to run any editing operations. The background removal and replacement, color correction, removing reflections from windows, etc. – are taken care of by the application. You don’t need any experience or skills to use automated editors, making it a brilliant option for amateurs.\"\n    },\n    FirstHeading: {\n        Heading: \"Why do you Need a Car Photo Editing App?\",\n        FirstDescription: {\n            Description: \"If you want your business to prosper, then you should have a robust online presence. Your business needs to have an outlet on the internet to attract new buyers, as well as a strong social media presence to sustain in this competitive market. For that, you need high-impact car images and videos. There are plenty of reasons why your visuals need to be top-notch:\",\n            Points: [\n                {\n                    Point: \"Good-quality images and videos help consumers trust your brand\"\n                },\n                {\n                    Point: \"Standardized images on your VDPs help bring visual consistency to your website\"\n                },\n                {\n                    Point: \"If your vehicle looks incredible in the picture, you’ll be able to upsell them\"\n                },\n                {\n                    Point: \"People often check a brand’s online presence before indulging in business with them, and a good social media presence can help build consumer trust further\"\n                }\n            ]\n        },\n        SecondDescription: \"If you want to influence a buyer’s purchasing decision in your favor, you have to be one step ahead of your rivals in the interweb space.\",\n        ThirdSubDescription: \"Also, it’s not easy to shoot high-quality photographs at all times. Even when the conditions are perfect, you’ll need to remaster your images (and videos) in post-production to get the best impact. How can you do that? Simple, through the utilization of photo editing apps! They are essential in maintaining a solid social media presence, without which you can’t excel in the digital world.\",\n        FourthSubDescription: \"There are a few apps that specialize in preparing images for sharing on social platforms. This is one of the best car photo editing apps you can use for your business as a filter and sync it across multiple devices easily. So, car retailers that include car dealerships and autonomous sellers need it the most to boost their social presence on the web. Editing will ensure they can revamp their pictures and draw more people into their fold.\",\n        FifthSubDescription: [\n            {\n                point: \"Give a professional look to your social media photos that stamp their brand’s authority\"\n            },\n            {\n                point: \"Touch-up the photographs – Regulate the brightness and contrast, adjust the colors, etc.\"\n            },\n            {\n                point: \"Creating a better visual language for your marketplace/digital dealership\"\n            }\n        ]\n    },\n    SecondHeading: {\n        Heading: \"Benefits of Using a Car Photo Editor\",\n        Description: \"Apart from making your life easy, do car photography apps have any significant benefits? Yes, plenty! Let’s discover some convenient benefits of such apps:\",\n        Ponits: [\n            {\n                Description: \"Makes your website look more professional and consistent by improving VDPs using standardized visuals\"\n            },\n            {\n                Description: \"To create a strong visual brand, you can use a photo editing app that allows you to appropriately brand your vehicles\"\n            },\n            {\n                Description: \"Beautifully edited car pictures are great for email marketing, social media marketing, and several other channels perfectly\"\n            },\n            {\n                Description: \"Some applications have presets – such as car presets for console mobile – that help simplify the editing process further\"\n            },\n            {\n                Description: \"Photo editing apps make it easy to resize and crop images so that they can meet the upload requirements for different social platforms, marketplaces, etc.\"\n            },\n            {\n                Description: \"Numerous editing apps compress the image to a smaller size without compromising its quality. Eventually, it reduces the load time and enhances your website rankings on SERP.\"\n            },\n            {\n                Description: \"An aesthetically appealing photo brings a ‘premium’ look to your website that creates a positive impact on the minds of the buyers and increases brand recognition\"\n            },\n            {\n                Description: \"Great visuals also help you capture the attention of online car buyers, thereby bringing a potential boost to your sales numbers\"\n            }\n        ],\n        SubDescription: \"Let’s dive a little deeper into that last point – how better images and videos can help you capture audiences on an online sales platform:\",\n        FirstSubHeading: {\n            Heading: \"Shooting 360-degree car spin video\",\n            DescriptionOne: \"Google research found that more than 90% of customers do extensive research on the internet before buying a car. This includes searching for all the options in their budget (sometimes beyond!) and looking for the different dealerships from where they can buy the vehicle. It also includes checking a particular model out thoroughly before making a purchase or physically visiting a dealership to see it.\",\n            DescriptionTwo: \"For used car dealerships, it’s crucial that all the cars listed be showcased in a manner that allows people to check them out from all corners without breaking a sweat. One great way to do that is via 360-degree spin car videos. Rotating views are a great way for people to see how an automobile looks from different angles; you can showcase both the interior and exterior of the vehicle.\",\n            DescriptionThree: \"In fact, Google research also shows that 56% of car buyers can be convinced to buy a vehicle purely online, without even the need for a test drive. Through new-age visual media like 360-degree videos! However, editing (and shooting) such visuals aren’t easy.\",\n            DescriptionFour: \"You could manually click and edit Car 360 Visuals, but it’s quite a Herculean task. Unless you’re skilled in photography and editing, you’d only get sub-par output.  With this AI tool, you can easily create 360-degree views using these platforms, without the need for any professional help. Otherwise, you need to get a Car Studio and hire a photography crew to take care of these tasks for you.\",\n            DescriptionFive: \"You also need attractive videos and pictures for advertisements and promotions. No matter how great your images are, you definitely need a lot of manipulation and editing in order to ready them for promotions! No matter how you look at it, you’ll definitely need editing software for these!\"\n        }\n    },\n    ThirdHeading: {\n        Heading: \"Spyne AI: The Best Car Photography and Editing App for Your Business\",\n        FirstPara: \"If you’re in the market for good editing software for your \",\n        FirstParaLink: \"https://www.spyne.ai/blogs/automotive-digital-retailing\",\n        FirstParaLinktext: \"car retail business\",\n        FirstParaContinue: \", It is a brilliant choice. The AI-led platform offers automated image editing, helping you create HD car images in seconds! We are here to transform your digital merchandising for automobile sellers, helping them dominate the online space. With our AI car photo editor, you get: \",\n        SecondPara: [\n            {\n                Point: \"1) Automatic car photo background replacement\"\n            },\n            {\n                Point: \"2) Choice of over 100 backgrounds, with the ability to upload custom backdrops\"\n            },\n            {\n                Point: \"3) Automatic removal of reflections from car windows and windshields\"\n            },\n            {\n                Point: \"4) Automatic color correction for consistent visual quality in batch processing\"\n            },\n            {\n                Point: \"5) Automatic generation of shadows and reflections on the virtual floor for a studio-like effect\"\n            },\n            {\n                Point: \"6) Automatic centering and framing of the vehicle to maintain viewer focus\"\n            },\n            {\n                Point: \"7) Window tinting feature\"\n            },\n            {\n                Point: \"8) Number plate masking option\"\n            }\n        ],\n        ThirdPara: \"This car photo editor can be accessed via the smartphone app (for Android and iOS) or the Console web application on your browser. The system instructs on how to edit the perfect car pictures so that you don’t have to rely on outside help! It is one of the best apps for \",\n        ThirdParaLink: \"https://www.spyne.ai/blogs/car-photography-photoshoot\",\n        ThirdParaLinkText: \"car photography\",\n        ThirdParaContinue: \"!\",\n        FourthPara: {\n            Description: \"Here’s why you should opt for this best AI-powered editing platform for your car retail business:\",\n            Points: [\n                {\n                    Point: \"Arrive to market with lightning speed Our automated photo editor platform processes images much faster, allowing your vehicles to be listed for sale 40% faster.\"\n                },\n                {\n                    Point: \"100% consistent cataloging We provide an AI-guided shoot and edit process to ensure a consistent catalog for your dealership.\"\n                },\n                {\n                    Point: \"Presenting viewers with engaging content We create visual content that can get more than 90% views and half the likes on several social media platforms.\"\n                },\n                {\n                    Point: \"Saving expenditure Instead of investing in a studio or hiring professionals with hefty photography equipment. Our automation software offers cost-saving software that ensures better facilities at a low price.\"\n                }\n            ]\n        },\n        FifthPara: \"Almost all modern dealerships and automotive marketplaces now vouch for Artificial Intelligence (AI) for their photography needs to different degrees.\"\n    },\n    Conclusion: {\n        Heading: \"Conclusion\",\n        FirstPara: \"The choice of a car photo editor app is crucial for your car retail business's digital success. High-quality images and videos are vital for attracting customers and building trust. We stand out as the top choice, offering automated background replacement, a vast backdrop selection, reflection removal, color correction, shadow generation, and more. This app ensures lightning-fast image processing, a consistent catalog, engaging content, and cost savings. Modernize your dealership with Spyne AI's AI-powered features and make a lasting impact in the digital automotive market. Get started today and stay ahead in the online world of car retailing.\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./components/car-photo-editor-app/config.js\n");

